  return (
    <div>
    <p>How many workouts a week?</p>
    <select>
      {days_per_week.map((day, key) => (  
        <option va>
          {day+1}
        </option>


      ))}
    </select>
      <button onClick={() => setUser({ ...user, test: "test" })}>Next</button>
    </div>
  );
}
